import { Link } from 'react-router-dom';

const LinkArray = [
    
    {path: '/', label: 'Home'},
    {path: '/about', label: 'About'},
    {path: '/product', label: 'Product'}
    
    // <Link to='/' > Home</Link >,
    // <Link to='/about'>About</Link>,
    // <Link to='/product'>Product</Link>
]

export default LinkArray;
